import { BrowserRouter as Router, Link, Routes, Route} from "react-router-dom";
import Home from "./Home.js"

function Header() {
    return (
      <Router>
        <Link to="/">charlie</Link>
        <Routes>
          <Route path="/" element={<Home/>}/>
        </Routes>
      </Router>
    );
  }

  export default Header;

  const Wrapper = styled.div`
display: flex;
`
